import { useNavigate } from 'react-router-dom';
import "./Title.css";
import React from 'react';

 function Title() {
    const navigate=useNavigate();

    const handleClick= () => {
        navigate('/home');
    };
    return (<div onClick={handleClick}>
    KITTIVISION
</div>
    );
}

export default Title;
